import { BrowserRouter, Route, Routes } from "react-router-dom";
import PasswordCheck from "./Password";
import Messanger from "./Messanger";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<PasswordCheck />} />
          <Route path="/messanger" element={<Messanger />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
